import { CSSProperties } from "react";

// I copied this straight from the openai website html, and modified it for react.
interface Props {
  size: number;
  backgroundColor?: string;
  style?: CSSProperties;
}

// NOTE: The SVG version sometimes does not render. Chrome Bug?
// https://stackoverflow.com/questions/38990880/svg-gradient-not-working
export default function GoogleGeminiLogo({
  size,
  backgroundColor = "transparent",
  style,
}: Props) {
  return (
    <div
      style={{
        width: size,
        height: size,
        display: "inline-block",
        position: "relative",
        ...style,
      }}
    >
      <div
        style={{
          position: "absolute",
          backgroundColor,
          color: "white",
          height: size,
          top: "0px",
        }}
      >
        <img
          alt="Google Gemini Logo"
          width={size}
          height={size}
          src="data:image/png;base64,"
        ></img>
      </div>
    </div>
  );
}
